export default function CommentList({ comments }) {
  return (
    <section>
      <h2>Comments</h2>
      <article>
        {comments.map((comment) => (
          <li key={comment.id}>
            <h3>{comment.name}</h3>
            <p>{comment.textarea}</p>
          </li>
        ))}
      </article>
    </section>
  );
}
